def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], i, j, [(grid[i][j])]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        val, x, y, path = heappop(pq)
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        if len(path) == k:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
