from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    start_values = [(grid[i][j], i, j) for i in range(N) for j in range(N)]
    start_values.sort()  # Sort starting points by value

    def neighbors(i, j):
        for ni, nj in ((i-1, j), (i+1, j), (i, j-1), (i, j+1)):
            if 0 <= ni < N and 0 <= nj < N:
                yield ni, nj

    # BFS with priority queue for lexigraphically smallest path
    for value, x, y in start_values:
        visited = {(x, y): [value]}
        queue = [(value, x, y, [value])]

        while queue:
            _, i, j, path = heappop(queue)
            if len(path) == k:
                return path

            for ni, nj in neighbors(i, j):
                new_path = path + [grid[ni][nj]]
                if (ni, nj) not in visited or len(visited[(ni, nj)]) < len(new_path):
                    visited[(ni, nj)] = new_path
                    heappush(queue, (grid[ni][nj], ni, nj, new_path))

