    # Calculate the number of valid triples
    # Choose 3 from mod0, choose 2 from mod0 and 1 from mod1, etc.
    return mod0 * (mod0 - 1) * (mod0 - 2) // 6 + mod1 * (mod1 - 1) * (mod1 - 2) // 6 + mod2 * (mod2 - 1) * (mod2 - 2) // 6 + mod0 * mod1 * mod2

