    for i in range(2, n + 1):
        if i % 2 == 0:
            tribonacci.append(1 + i // 2)
        else:
            if i + 1 <= n:  # If the next value can be directly calculated
                tribonacci.append(1 + (i + 1) // 2)
            else:  # If the next value is out of range, use the formula
                tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 1] + tribonacci[i - 2] + 1 + (i // 2))

