def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 1  # Only '1' meets the criteria
    else:
        # For numbers starting with 1: 1xxxx...x (10^(n-1) choices)
        # For numbers ending with 1: x...x1 (9 * 10^(n-2) choices, since the first digit can't be 0)
        # Total = 10^(n-1) + 9 * 10^(n-2)
        # But '1' at the start and end are counted twice if n > 1, so subtract 1 to correct
        return 10**(n-1) + 9 * 10**(n-2) - (1 if n > 1 else 0)

