def tri(n):
    """Returns the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [3]
    if n == 1:
        return [3, 2]

    trib = [3, 2, 8]  # Base cases for tri(0), tri(1), and tri(2) as defined
    while len(trib) <= n:
        if len(trib) % 2 == 0:  # If the next index is even
            trib.append(1 + len(trib) / 2)
        else:
            next_val = trib[-1] + trib[-2] + trib[-3]
            trib.append(next_val)

    return trib[:n+1]

