def match_parens(lst):
    '''
    Function to check if concatenating two strings consisting of parentheses
    in some order results in a balanced string.
    '''
    first, second = lst
    # If both strings have equal number of '(' and ')', they can always form a good string
    if first.count('(') == first.count(')') and second.count('(') == second.count(')'):
        return 'Yes'
    # If first string starts with ')' or ends with '(', it cannot be made good by concatenation
    if first.startswith(')') or first.endswith('('):
        if second.startswith(')') or second.endswith('('):
            return 'No'
    # If second string starts with ')' or ends with '(', it cannot be made good by concatenation
    if second.startswith(')') or second.endswith('('):
        if first.startswith(')') or first.endswith('('):
            return 'No'
    # Check if concatenating in either order forms a good string
    if is_good(first + second) or is_good(second + first):
        return 'Yes'
    return 'No'

