from heapq import heappush, heappop

def minPath(grid, k):
    n = len(grid)  # Assuming grid is N x N
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]  # Right, Down, Up, Left
    heap = [(grid[i][j], k-1, i, j, [grid[i][j]]) for i in range(n) for j in range(n)]
    heap.sort()  # Pre-sort the heap for lexicographical order
    visited = set()

    while heap:
        _, steps, x, y, path = heappop(heap)
        if steps == 0:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and (nx, ny, steps-1) not in visited:
                visited.add((nx, ny, steps-1))
                heappush(heap, (path + [grid[nx][ny]], steps-1, nx, ny, path + [grid[nx][ny]]))

