from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    # Convert grid to value-coordinate map for quick access to positions
    val_to_pos = {grid[i][j]: (i, j) for i in range(N) for j in range(N)}
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]  # right, left, down, up

    # Min-heap to maintain paths with their costs
    # Each element in the heap: (path_cost_list, last_val, last_row, last_col, path_length)
    heap = [([val], val, val_to_pos[val][0], val_to_pos[val][1], 1) for val in range(1, N*N + 1)]

    while heap:
        path, last_val, r, c, length = heappop(heap)
        if length == k:
            return path
        for dr, dc in directions:
            nr, nc = r + dr, c + dc
            if 0 <= nr < N and 0 <= nc < N:
                new_val = grid[nr][nc]
                heappush(heap, (path + [new_val], new_val, nr, nc, length + 1))

def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    sequence = [1, 3, 2]  # Initialize with the first three values
    for i in range(3, n + 1):
        if i % 2 == 0:
