from heapq import heappop, heappush

def minPath(grid, k):
    n = len(grid)
    moves = [(0, 1), (1, 0), (0, -1), (-1, 0)]  # Right, Down, Left, Up
    # Convert grid to value -> (row, column) for easier tracking of positions
    val_to_pos = {grid[i][j]: (i, j) for i in range(n) for j in range(n)}
    # Priority queue for BFS: (lexicographical list, current position, steps left)
    pq = []
    for val, (i, j) in val_to_pos.items():
        heappush(pq, ([val], i, j, k - 1))

    while pq:
        path, r, c, steps_left = heappop(pq)
        if steps_left == 0:
            return path
        for dr, dc in moves:
            nr, nc = r + dr, c + dc
            if 0 <= nr < n and 0 <= nc < n:
                new_path = path + [grid[nr][nc]]
                heappush(pq, (new_path, nr, nc, steps_left - 1))

