    """
    Finds all occurrences of integer x in a 2D list and returns a list of tuples representing their positions.
    Positions are sorted first by row in ascending order, then by column in descending order within each row.
    """
    positions = []
    for i, row in enumerate(lst):
        for j, val in enumerate(row):
            if val == x:
                positions.append((i, j))
    # Sort by row in ascending order, and then by column in descending order
    return sorted(positions, key=lambda position: (position[0], -position[1]))

def sort_array(array):
    """
    Given an array of non-negative integers, return a copy of the given array after sorting,
    you will sort the given array in ascending order if the sum( first index value, last index value) is odd,
    or sort it in descending order if the sum( first index value, last index value) is even.
    """
    if not array:
        return []
    if (array[0] + array[-1]) % 2 == 0:
        return sorted(array, reverse=True)
    else:
        return sorted(array)

def encrypt(s):
    result = ""
    for char in s:
        if 'a' <= char <= 'z':
            result += chr((ord(char) - ord('a') + 4) % 26 + ord('a'))
        elif 'A' <= char <= 'Z':
            result += chr((ord(char) - ord('A') + 4) % 26 + ord('A'))
        else:
            result += char
    return result

