def histogram(text):
    # Split the text into words
    words = text.split()
    # Create an empty dictionary to store letter frequency
    freq = {}
    # Iterate over each word in the list
    for word in words:
        # Increment the letter's count in freq
        freq[word] = freq.get(word, 0) + 1
    # Find the maximum count
    max_count = max(freq.values(), default=0)
    # Return letters that have the maximum count
    return {letter: count for letter, count in freq.items() if count == max_count}

