def match_parens(lst):
    first, second = lst
    # If both strings are already balanced, any order works.
    if first.count('(') == first.count(')') and second.count('(') == second.count(')'):
        return 'Yes'
    # If concatenating first + second is balanced, it works.
    elif first.count('(') - first.count(')') == second.count(')') - second.count('('):
        return 'Yes'
    # If concatenating second + first is balanced, it works.
    elif second.count('(') - second.count(')') == first.count(')') - first.count('('):
        return 'Yes'
    # No way to make a good string
    else:
        return 'No'

def get_odd_collatz(n):
    """
    Given a positive integer n, return a sorted list that has the odd numbers in collatz sequence.
    """
    odd_numbers = []
    while n != 1:
        if n % 2 != 0:
            odd_numbers.append(n)
        n = 3 * n + 1 if n % 2 else n // 2
    odd_numbers.append(1)
    return sorted(odd_numbers)

def valid_date(date):
    if not date or "-" not in date:
        return False
    date_parts = date.split("-")
    if len(date_parts) != 3:
        return False
    month, day, year = date_parts
    if not (month.isdigit() and day.isdigit() and year.isdigit()):
        return False
    month, day = int(month), int(day)
    if not (1 <= month <= 12):
        return False
    if month in [1, 3, 5, 7, 8, 10, 12]:
        if not (1 <= day <= 31):
            return False
    elif month in [4, 6, 9, 11]:
        if not (1 <= day <= 30):
            return False
    elif month == 2:
        if not (1 <= day <= 29):
            return False
    return True

