    magnitude_sum = 0
    for num in arr:
        sign_product *= 1 if num > 0 else -1 if num < 0 else 0
        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    value_to_pos = {grid[i][j]: (i, j) for i in range(N) for j in range(N)}

    def neighbors(val):
        i, j = value_to_pos[val]
        for di, dj in moves:
            if 0 <= i + di < N and 0 <= j + dj < N:
                yield grid[i + di][j + dj]

    def dijkstra():
        pq = [(0, [grid[0][0]])]  # cost, path
        seen = {(grid[0][0], 1): 0}
        while pq:
            cost, path = heappop(pq)
            if len(path) == k:
                return path
            for nei in neighbors(path[-1]):
                new_cost = cost + 1
                new_path = path + [nei]
                if (nei, len(new_path)) not in seen or seen[(nei, len(new_path))] > new_cost:
                    seen[(nei, len(new_path))] = new_cost
                    heappush(pq, (new_cost, new_path))

    return dijkstra()

def tri(n):
    # Cache to store calculated values
    cache = {1: 3}

    # Helper function to calculate tribonacci using memoization
    def helper(x):
        if x in cache:
            return cache[x]
        if x % 2 == 0:
            cache[x] = 1 + x / 2
        else:
            cache[x] = helper(x-1) + helper(x-2) + helper(x+1)
        return cache[x]

    # Calculate tribonacci numbers up to n+1
    for i in range(2, n + 2):
        helper(i)

    # Return the first n+1 tribonacci numbers
    return [cache[i] for i in range(1, n + 2)]

def digits(n):
    product = 1
    has_odd = False
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
            has_odd = True
        n //= 10
    return product if has_odd else 0

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False
            stack.pop()
            if stack:
                return True
    return False

