from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    # Directions: up, down, left, right
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    # Priority queue for BFS, format: (path_cost, path_length, x, y, path)
    pq = []
    # Initialize priority queue with all positions in the grid
    for i in range(N):
        for j in range(N):
            heappush(pq, ([grid[i][j]], 1, i, j, [grid[i][j]]))

    while pq:
        _, length, x, y, path = heappop(pq)
        # If path length equals k, return the path
        if length == k:
            return path
        # Explore all 4 directions
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                # Add new cell to path and push new state to the priority queue
                newPath = path + [grid[nx][ny]]
                heappush(pq, (newPath, length + 1, nx, ny, newPath))

def tri(n):
    """
    Calculate the first n + 1 numbers of the Tribonacci sequence.
    """
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]

    tribonacci = [1, 3]

    for i in range(2, n + 1):
        if i % 2 == 0:
            tribonacci.append(1 + i / 2)
        else:
            # For odd i greater than 2, calculate the next tribonacci number
            # Note: The problem statement for tri(n) = tri(n - 1) + tri(n - 2) + tri(n + 1) seems incorrect 
            # because it requires the future element tri(n + 1) which we cannot know at the time of calculation.
            # Assuming a probable typo and considering a usual Tribonacci definition for the odd case:
            tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 3])

    return tribonacci

