def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_heap = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    min_heap.sort()
    visited = set()

    while min_heap:
        _, x, y, path = heappop(min_heap)
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        if len(path) == k:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N and (nx, ny, len(path) + 1) not in visited:
                heappush(min_heap, (grid[nx][ny], nx, ny, path + [grid[nx][ny]]))

