def check_if_last_char_is_a_letter(txt):
    if not txt or not txt.strip().endswith((' ', '.', '!', '?', ',')) or not txt.strip()[-2].isalpha():
        return False
    return True

def can_arrange(arr):
    for i in range(len(arr)-1, 0, -1):
        if arr[i] < arr[i-1]:
            return i
    return -1

def largest_smallest_integers(lst):
    negatives = [x for x in lst if x < 0]
    positives = [x for x in lst if x > 0]
    largest_neg = max(negatives) if negatives else None
    smallest_pos = min(positives) if positives else None
    return (largest_neg, smallest_pos)

def compare_one(a, b):
    def convert_to_float(x):
        if isinstance(x, str):
            x = x.replace(',', '.')
        return float(x)

    a_float = convert_to_float(a)
    b_float = convert_to_float(b)

    if a_float > b_float:
        return a
    elif b_float > a_float:
        return b
    else:
        return None

def special_factorial(n):
    """Calculate the Brazilian factorial of n."""
    def factorial(x):
        if x == 0 or x == 1:
            return 1
        else:
            return x * factorial(x-1)

    result = 1
    for i in range(1, n+1):
        result *= factorial(i)

    return result

def words_in_sentence(sentence: str) -> str:
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    words = sentence.split()
    prime_length_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_length_words)

def specialFilter(nums):
    def is_first_and_last_digit_odd(n):
        n_str = str(abs(n))
        return n_str[0] in '13579' and n_str[-1] in '13579'

    return sum(1 for num in nums if num > 10 and is_first_and_last_digit_odd(num))

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    index1, index2 = planets.index(planet1), planets.index(planet2)
    if index1 < index2:
        return tuple(planets[index1+1:index2])
    else:
        return tuple(planets[index2+1:index1])

def x_or_y(n, x, y):
    if n < 2:
        return y
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return y
    return x

def double_the_difference(lst):
    '''
    Given a list of numbers, return the sum of squares of the numbers
    in the list that are odd. Ignore numbers that are negative or not integers.
    '''
    return sum(x**2 for x in lst if x > 0 and x % 2 == 1)

def cycpattern_check(a, b):
    """Check if the second word or any of its rotations is a substring in the first word"""
    for i in range(len(b)):
        if b[i:] + b[:i] in a:
            return True
    return False

def even_odd_count(num):
    num_str = str(abs(num))
    even_count = sum(1 for digit in num_str if int(digit) % 2 == 0)
    odd_count = sum(1 for digit in num_str if int(digit) % 2 != 0)
    return (even_count, odd_count)

def right_angle_triangle(a, b, c):
    sides = sorted([a, b, c])
    return sides[0]**2 + sides[1]**2 == sides[2]**2

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(1, len(operand)):
        expression += " " + operator[i - 1] + " " + str(operand[i])
    return eval(expression)

def solve(s):
    """Reverses the case of letters in a string, or reverses the string if no letters are present."""
    if not any(c.isalpha() for c in s):
        return s[::-1]
    else:
        return ''.join(c.lower() if c.isupper() else c.upper() if c.islower() else c for c in s)

import hashlib

def string_to_md5(text: str) -> str:
    """
    Given a string 'text', return its md5 hash equivalent string.
    If 'text' is an empty string, return None.

    >>> string_to_md5('Hello world') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()

def generate_integers(a, b):
    """
    Given two positive integers a and b, return the even digits between a
    and b, in ascending order.
    """
    return sorted(set(range(a, b + 1)) & set(range(2, 10, 2)))
